import * as helaperApi from "../Api/helperApis.js";

export const addNewTeam = async (NewTeamName) => {
  

  helaperApi
    .createNewTeam(NewTeamName)
    .then((data) => {
      console.log(data, "Data");
      return data;
    })
    .catch((error) => {
      console.log(error);
    });
};
